import React from "react"

function Mapping(){
    const object = [
      { name : "muneeb", age: "22" , email : "abc@email.com"},
      {name : "abeeer", age: "21" , email: "xyz@email.com"}

    ]

    return(
        <div>
            <h1>Mapping</h1>
            <h2>
                {
                    object.map((item)=>
                    <div>

                        <span>{item.name}</span>
                        {item.age}
                        {item.email}
                    </div>

                    )
                }
            </h2>
        </div>
    )
}

export default Mapping
